import React from 'react';
import { BrowserRouter as Router, Route, Routes } from 'react-router-dom';
import Login from './pages/Login'; // Ensure path is correct
import Signup from './pages/Signup'; // Ensure path is correct
import DoctorHome from './pages/DoctorHome'; // Ensure path is correct
import ClinicalHome from './components/ClinicalHome'; // Ensure path is correct
import AdminHome from './components/AdminHome'; // Ensure path is correct

function App() {
    return (
        <Router>
            <Routes>
                <Route path="/" element={<Login />} />
                <Route path="/signup" element={<Signup />} />
                <Route path="/doctor-home/*" element={<DoctorHome />} /> {/* Nested routes can be added in DoctorHome */}
                <Route path="/clinical-home" element={<ClinicalHome />} />
                <Route path="/admin-home" element={<AdminHome />} />
            </Routes>
        </Router>
    );
}

export default App;
